import React from 'react'
import { useNavigate } from 'react-router-dom'

const Success = () => {
    const navigate = useNavigate()
    return (
        <div>
            <div className='card p-4'>
            <h1 className='text-center'>Payment Successfully Done!</h1>
            <a onClick={()=>navigate('/catalog')} className='btn btn-primary'>Done</a>
            </div>
        </div>
    )
}

export default Success
